; PrimaryType: The basic type of this tileset file.
;  Types are Clear, Water, Rock and Beach.
;  Clear and Beach are passable.
;  Beach cannot be built on, and helis can't land on it.
;  (Since these types take up IDs 0,2,3,6 there are probably more types, but
;   they're not used for terrain tiles, and I haven't tested their effects)
; SecondaryType: Secondary type of this tileset file.
; SecondaryTypeCells: List of cell numbers that use the secondary type.
; X and Y are the tile dimensions. They are unused by the game, and probably
;  leftovers from an inbuilt map editor.
; NameID: Name ID number in the strings file
;
; Omitted from this list is the Theater Ownership value, since I changed it to
; "All Theaters" for all tiles for modding purposes.


; this one is duplicated for the "-1" value on the maps
